import os
import json
import asyncio
from typing import Optional, List

import requests

from util.retry import retry
from util.validate import generate_uid
from service.ragfusion.core.document.document import Document

UMI_OCR_URL = os.environ["UMI_OCR_URL"]

def umi_ocr_params():
    """
    get ocr params
    """
    request_url = "/".join([UMI_OCR_URL, "api/doc/get_options"])

    # do request
    response = requests.request("GET", request_url)
    return response.text


def umi_file_upload(
        buffer: bytes,
) -> Optional[str]:
    """
    upload file to ocr task

    :param buffer: s3 file's buffer

    :return:
       `str`, ocr task id
    """
    request_url = "/".join([UMI_OCR_URL, "api/doc/upload"])

    # generate file name random
    pdf_file_name = generate_uid(5) + ".pdf"

    # do request
    response = requests.post(
        request_url,
        files={'file': (pdf_file_name, buffer, 'application/pdf')}
    )
    response = json.loads(response.content)
    code = response['code']
    if code == 100:
        return response["data"]
    else:
        return None


def umi_file_delete(task_id: str) -> bool:
    """
    delete ocr task

    :param task_id: task id
    """
    if not task_id: return False

    request_url = "/".join([UMI_OCR_URL, f"api/doc/clear/{task_id}"])

    # do request
    response = requests.request("GET", request_url)
    response = json.loads(response.content)
    code = response['code']
    if code == 100 or code == 101:
        return True
    else:
        print(response["data"])
        return False


async def umi_task_result(task_id: str) -> List:
    """
    get task result

    :param task_id: task id

    :return:
        `List`, content of page
    """
    if not task_id: return {}

    request_url = "/".join([UMI_OCR_URL, "api/doc/result"])
    payload = json.dumps({
       "id": task_id,
       "is_data": True,
       "is_unread": True,
       "format": "dict"
    })
    headers = {
       'Content-Type': 'application/json'
    }

    # do request
    ds = []
    while True:
        response = requests.request("POST", request_url, headers=headers, data=payload)
        response = json.loads(response.content)

        # code
        code = response['code']
        if code != 100: return []

        # parse
        data = response["data"]
        for page_status in data:
            d = Document(
                page_content=" ".join([c["text"] for c in page_status.get("data")]),
                metadata={"page_num": page_status.get("page")}
            )
            ds.append(d)

        if response["is_done"]:
            break

        # if task not complete, just wait
        await asyncio.sleep(1)

    return ds


@retry
def umi_image_result(image: str) -> str:
    """
    get image result

    :param image: image base64 code

    :return:
        `str`, content of image
    """
    if not image: return ""

    request_url = "/".join([UMI_OCR_URL, "api/ocr"])
    data = {
        "base64": image,
        "options": {
            "data.format": "text",
            # "ocr.language": "models/config_chinese.txt",
            # "ocr.cls": True,
            # "ocr.limit_side_len": 4320,
            # "tbpu.parser": "multi_none",
        }
    }
    headers = {"Content-Type": "application/json"}
    data_str = json.dumps(data)

    # do request
    print("Start ocr image request...")
    response = requests.post(request_url, data=data_str, headers=headers, timeout=10)
    print("End ocr image request...")
    response.raise_for_status()
    res_dict = json.loads(response.text)
    print(res_dict)
    if res_dict["code"] == 100:
        return res_dict.get("data", "")
    else:
        return ""

